import React from "react";

import './swiper.css'
import wall from "../../assets//banner.png";
const Swipper = () => {
  return (
    <div className="slider">

        <div className="slide-img">
          <img src={wall} alt="" />
        </div>
    </div>
  );
};

export default Swipper;
